import {TodoItem} from "./todoitem";

export class Model{
    name:string;
    items:TodoItem[];

    constructor(){
        this.name="Oğuz";
        this.items=[ {description:"kahvalt",action:"yes"},
        {description:"spor",action:"yes"},
        {description:"alışveriş",action:"no"}]
    }
}
